  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset is comprised of acoustic data
  recorded from SIMRAD ES-60 and ES-70 echosounders on board commercial fishing vessels
  fishing walleye pollock in the Bering Sea, during the winter (January - April).
  This data collection began in 2002 and continues to present with between 2 to 6
  vessels collecting data annually. RAW data files store the acoustic return as well
  as GPS location, date, and time. OUT data files paired with the RAW data files store
  bottom depth as determined by a SIMRAD internal algorithm.nnnn\",\n\t\"owner_org\":
